        "fct-descr": "\u003cp\u003eExtract \u003ccode\u003e\u003ca\u003eeach\u003c/a\u003e\u003c/code\u003e element of a (potentially monomorphic) container.\n\u003c/p\u003e\u003cp\u003eNotably, when applied to a tuple, this generalizes \u003ccode\u003e\u003ca\u003eboth\u003c/a\u003e\u003c/code\u003e to arbitrary homogeneous tuples.\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(1,2,3) & each *~ 10\n\u003c/code\u003e\u003c/strong\u003e(10,20,30)\n\u003c/pre\u003e\u003cp\u003eIt can also be used on monomorphic containers like \u003ccode\u003e\u003ca\u003eText\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003eByteString\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover each Char.toUpper (\"hello\"^.Text.packed)\n\u003c/code\u003e\u003c/strong\u003e\"HELLO\"\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(\"hello\",\"world\") & each.each %~ Char.toUpper\n\u003c/code\u003e\u003c/strong\u003e(\"HELLO\",\"WORLD\")\n\u003c/pre\u003e",
