        "fct-descr": "\u003cp\u003eObtain an \u003ccode\u003eAffineFold\u003c/code\u003e that can be composed with to filter another \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003e\u003ca\u003eIso\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003e\u003ca\u003eFold\u003c/a\u003e\u003c/code\u003e (or \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e).\n\u003c/p\u003e\u003cp\u003eNote: This is \u003cem\u003enot\u003c/em\u003e a legal \u003ccode\u003eAffineTraversal\u003c/code\u003e, unless you are very careful not to invalidate the predicate on the target.\n\u003c/p\u003e\u003cp\u003eNote: This is also \u003cem\u003enot\u003c/em\u003e a legal \u003ccode\u003e\u003ca\u003ePrism\u003c/a\u003e\u003c/code\u003e, unless you are very careful not to inject a value that matches the predicate.\n\u003c/p\u003e\u003cp\u003eAs a counter example, consider that given \u003ccode\u003eevens = \u003ccode\u003e\u003ca\u003efiltered\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eeven\u003c/a\u003e\u003c/code\u003e\u003c/code\u003e the second \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e law is violated:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e evens \u003ccode\u003e\u003ca\u003esucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e evens \u003ccode\u003e\u003ca\u003esucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e/=\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e evens (\u003ccode\u003e\u003ca\u003esucc\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003esucc\u003c/a\u003e\u003c/code\u003e)\n\u003c/pre\u003e\u003cp\u003eSo, in order for this to qualify as a legal \u003ccode\u003eAffineTraversal\u003c/code\u003e you can only use it for actions that preserve the result of the predicate!\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e[1..10]^..folded.filtered even\n\u003c/code\u003e\u003c/strong\u003e[2,4,6,8,10]\n\u003c/pre\u003e\u003cp\u003eThis will preserve an index if it is present.\n\u003c/p\u003e",
