        "fct-descr": "\u003cp\u003eA \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e describes how to retrieve a single value in a way that can be\n composed with other \u003ccode\u003e\u003ca\u003eLensLike\u003c/a\u003e\u003c/code\u003e constructions.\n\u003c/p\u003e\u003cp\u003eUnlike a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e a \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e is read-only. Since a \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e\n cannot be used to write back there are no \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e laws that can be applied to\n it. In fact, it is isomorphic to an arbitrary function from \u003ccode\u003e(s -\u003e a)\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eMoreover, a \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e can be used directly as a \u003ccode\u003e\u003ca\u003eFold\u003c/a\u003e\u003c/code\u003e,\n since it just ignores the \u003ccode\u003e\u003ca\u003eApplicative\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e",
