        "fct-descr": "\u003cp\u003eA \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e is actually a lens family as described in\n \u003ca\u003ehttp://comonad.com/reader/2012/mirrored-lenses/\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eWith great power comes great responsibility and a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e is subject to the\n three common sense \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e laws:\n\u003c/p\u003e\u003cp\u003e1) You get back what you put in:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eview\u003c/a\u003e\u003c/code\u003e l (\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v s)  &#8801; v\n\u003c/pre\u003e\u003cp\u003e2) Putting back what you got doesn't change anything:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l (\u003ccode\u003e\u003ca\u003eview\u003c/a\u003e\u003c/code\u003e l s) s  &#8801; s\n\u003c/pre\u003e\u003cp\u003e3) Setting twice is the same as setting once:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v' (\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v s) &#8801; \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v' s\n\u003c/pre\u003e\u003cp\u003eThese laws are strong enough that the 4 type parameters of a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e cannot\n vary fully independently. For more on how they interact, read the \"Why is\n it a Lens Family?\" section of\n \u003ca\u003ehttp://comonad.com/reader/2012/mirrored-lenses/\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eThere are some emergent properties of these laws:\n\u003c/p\u003e\u003cp\u003e1) \u003ccode\u003e\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l s\u003c/code\u003e must be injective for every \u003ccode\u003es\u003c/code\u003e This is a consequence of law #1\n\u003c/p\u003e\u003cp\u003e2) \u003ccode\u003e\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l\u003c/code\u003e must be surjective, because of law #2, which indicates that it is possible to obtain any \u003ccode\u003ev\u003c/code\u003e from some \u003ccode\u003es\u003c/code\u003e such that \u003ccode\u003e\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e s v = s\u003c/code\u003e\n\u003c/p\u003e\u003cp\u003e3) Given just the first two laws you can prove a weaker form of law #3 where the values \u003ccode\u003ev\u003c/code\u003e that you are setting match:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v (\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v s) &#8801; \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l v s\n\u003c/pre\u003e\u003cp\u003eEvery \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e can be used directly as a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eYou can also use a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e for \u003ccode\u003e\u003ca\u003eGetting\u003c/a\u003e\u003c/code\u003e as if it were a\n \u003ccode\u003e\u003ca\u003eFold\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eSince every \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e is a valid \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e, the\n \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e laws are required of any \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e you create:\n\u003c/p\u003e\u003cpre\u003e\n l \u003ccode\u003e\u003ca\u003epure\u003c/a\u003e\u003c/code\u003e &#8801; \u003ccode\u003e\u003ca\u003epure\u003c/a\u003e\u003c/code\u003e\n \u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e (l f) \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e l g &#8801; \u003ccode\u003e\u003ca\u003egetCompose\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e l (\u003ccode\u003e\u003ca\u003eCompose\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e f \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e g)\n\u003c/pre\u003e\u003cpre\u003e\n type \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t a b = forall f. \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e f =\u003e \u003ccode\u003e\u003ca\u003eLensLike\u003c/a\u003e\u003c/code\u003e f s t a b\n\u003c/pre\u003e",
