        "fct-descr": "\u003cp\u003ePasses the result of the left side to the function on the right side (forward pipe operator).\n\u003c/p\u003e\u003cp\u003eThis is the flipped version of (\u003ccode\u003e\u003ca\u003e$\u003c/a\u003e\u003c/code\u003e), which is more common in languages like F# as (\u003ccode\u003e|\u003e\u003c/code\u003e) where it is needed\n for inference. Here it is supplied for notational convenience and given a precedence that allows it\n to be nested inside uses of (\u003ccode\u003e\u003ca\u003e$\u003c/a\u003e\u003c/code\u003e).\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003ea & f\n\u003c/code\u003e\u003c/strong\u003ef a\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e\"hello\" & length & succ\n\u003c/code\u003e\u003c/strong\u003e6\n\u003c/pre\u003e\u003cp\u003eThis combinator is commonly used when applying multiple \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e operations in sequence.\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(\"hello\",\"world\") & _1.element 0 .~ 'j' & _1.element 4 .~ 'y'\n\u003c/code\u003e\u003c/strong\u003e(\"jelly\",\"world\")\n\u003c/pre\u003e\u003cp\u003eThis reads somewhat similar to:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eflip execState (\"hello\",\"world\") $ do _1.element 0 .= 'j'; _1.element 4 .= 'y'\n\u003c/code\u003e\u003c/strong\u003e(\"jelly\",\"world\")\n\u003c/pre\u003e",
