        "fct-descr": "\u003cp\u003eModifies the target of a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e or all of the targets of a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e or\n \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e with a user supplied function.\n\u003c/p\u003e\u003cp\u003eThis is an infix version of \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e f &#8801; \u003ccode\u003e\u003ca\u003emapped\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e f\n \u003ccode\u003e\u003ca\u003efmapDefault\u003c/a\u003e\u003c/code\u003e f &#8801; \u003ccode\u003e\u003ca\u003etraverse\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e f\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(a,b,c) & _3 %~ f\n\u003c/code\u003e\u003c/strong\u003e(a,b,f c)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(a,b) & both %~ f\n\u003c/code\u003e\u003c/strong\u003e(f a,f b)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e_2 %~ length $ (1,\"hello\")\n\u003c/code\u003e\u003c/strong\u003e(1,5)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003etraverse %~ f $ [a,b,c]\n\u003c/code\u003e\u003c/strong\u003e[f a,f b,f c]\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003etraverse %~ even $ [1,2,3]\n\u003c/code\u003e\u003c/strong\u003e[False,True,False]\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003etraverse.traverse %~ length $ [[\"hello\",\"world\"],[\"!!!\"]]\n\u003c/code\u003e\u003c/strong\u003e[[5,5],[3]]\n\u003c/pre\u003e\u003cpre\u003e\n (\u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e) :: \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e s t a b    -\u003e (a -\u003e b) -\u003e s -\u003e t\n (\u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e) :: \u003ccode\u003e\u003ca\u003eIso\u003c/a\u003e\u003c/code\u003e s t a b       -\u003e (a -\u003e b) -\u003e s -\u003e t\n (\u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e) :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t a b      -\u003e (a -\u003e b) -\u003e s -\u003e t\n (\u003ccode\u003e\u003ca\u003e%~\u003c/a\u003e\u003c/code\u003e) :: \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e s t a b -\u003e (a -\u003e b) -\u003e s -\u003e t\n\u003c/pre\u003e",
