        "fct-descr": "\u003cp\u003eCompose a non-indexed function with an \u003ccode\u003e\u003ca\u003eIndexed\u003c/a\u003e\u003c/code\u003e function.\n\u003c/p\u003e\u003cp\u003eMnemonically, the \u003ccode\u003e\u003e\u003c/code\u003e points to the indexing we want to preserve.\n\u003c/p\u003e\u003cp\u003eThis is the same as \u003ccode\u003e(\u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e)\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003ef \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e g\u003c/code\u003e (and \u003ccode\u003ef \u003ccode\u003e\u003ca\u003e.\u003e\u003c/a\u003e\u003c/code\u003e g\u003c/code\u003e) gives you the index of \u003ccode\u003eg\u003c/code\u003e unless \u003ccode\u003eg\u003c/code\u003e is index-preserving, like a\n \u003ccode\u003e\u003ca\u003ePrism\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003e\u003ca\u003eIso\u003c/a\u003e\u003c/code\u003e or \u003ccode\u003e\u003ca\u003eEquality\u003c/a\u003e\u003c/code\u003e, in which case it'll pass through the index of \u003ccode\u003ef\u003c/code\u003e.\n\u003c/p\u003e",
