        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eA \u003ccode\u003e\u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e s t a b\u003c/code\u003e is a generalization of \u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e from \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e. It allows you to map into a\n structure and change out the contents, but it isn't strong enough to allow you to\n enumerate those contents. Starting with \u003ccode\u003e\u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e f =\u003e (a -\u003e b) -\u003e f a -\u003e f b\u003c/code\u003e\n we monomorphize the type to obtain \u003ccode\u003e(a -\u003e b) -\u003e s -\u003e t\u003c/code\u003e and then decorate it with \u003ccode\u003e\u003ca\u003eIdentity\u003c/a\u003e\u003c/code\u003e to obtain:\n\u003c/p\u003e\u003cpre\u003e\n type \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e s t a b = (a -\u003e \u003ccode\u003e\u003ca\u003eIdentity\u003c/a\u003e\u003c/code\u003e b) -\u003e s -\u003e \u003ccode\u003e\u003ca\u003eIdentity\u003c/a\u003e\u003c/code\u003e t\n\u003c/pre\u003e\u003cp\u003eEvery \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e is a valid \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e, since \u003ccode\u003e\u003ca\u003eIdentity\u003c/a\u003e\u003c/code\u003e is \u003ccode\u003e\u003ca\u003eApplicative\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eEverything you can do with a \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e, you can do with a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e. There\n are combinators that generalize \u003ccode\u003e\u003ca\u003efmap\u003c/a\u003e\u003c/code\u003e and (\u003ccode\u003e\u003ca\u003e\u003c$\u003c/a\u003e\u003c/code\u003e).\n\u003c/p\u003e\u003c/div\u003e",
