        "fct-descr": "\u003cp\u003eThis is used to characterize a \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003ea.k.a. indexed Cartesian store comonad, indexed Kleene store comonad, or an indexed \u003ccode\u003eFunList\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003e\u003ca\u003ehttp://twanvl.nl/blog/haskell/non-regular1\u003c/a\u003e\n\u003c/p\u003e\u003cp\u003eA \u003ccode\u003e\u003ca\u003eBazaar\u003c/a\u003e\u003c/code\u003e is like a \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e that has already been applied to some structure.\n\u003c/p\u003e\u003cp\u003eWhere a \u003ccode\u003e\u003ccode\u003e\u003ca\u003eContext\u003c/a\u003e\u003c/code\u003e a b t\u003c/code\u003e holds an \u003ccode\u003ea\u003c/code\u003e and a function from \u003ccode\u003eb\u003c/code\u003e to\n \u003ccode\u003et\u003c/code\u003e, a \u003ccode\u003e\u003ccode\u003e\u003ca\u003eBazaar\u003c/a\u003e\u003c/code\u003e a b t\u003c/code\u003e holds \u003ccode\u003eN\u003c/code\u003e \u003ccode\u003ea\u003c/code\u003es and a function from \u003ccode\u003eN\u003c/code\u003e\n \u003ccode\u003eb\u003c/code\u003es to \u003ccode\u003et\u003c/code\u003e, (where \u003ccode\u003eN\u003c/code\u003e might be infinite).\n\u003c/p\u003e\u003cp\u003eMnemonically, a \u003ccode\u003e\u003ca\u003eBazaar\u003c/a\u003e\u003c/code\u003e holds many stores and you can easily add more.\n\u003c/p\u003e\u003cp\u003eThis is a final encoding of \u003ccode\u003e\u003ca\u003eBazaar\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e",
