        "fct-descr": "\u003cp\u003e\u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e turns a \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e into a \u003ccode\u003e\u003ca\u003euniplate\u003c/a\u003e\u003c/code\u003e (or \u003ccode\u003e\u003ca\u003ebiplate\u003c/a\u003e\u003c/code\u003e) family.\n\u003c/p\u003e\u003cp\u003eIf you do not need the types of \u003ccode\u003es\u003c/code\u003e and \u003ccode\u003et\u003c/code\u003e to be different, it is recommended that\n you use \u003ccode\u003e\u003ca\u003epartsOf\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eIt is generally safer to traverse with the \u003ccode\u003e\u003ca\u003eBazaar\u003c/a\u003e\u003c/code\u003e rather than use this\n combinator. However, it is sometimes convenient.\n\u003c/p\u003e\u003cp\u003eThis is unsafe because if you don't supply at least as many \u003ccode\u003eb\u003c/code\u003e's as you were\n given \u003ccode\u003ea\u003c/code\u003e's, then the reconstruction of \u003ccode\u003et\u003c/code\u003e \u003cem\u003ewill\u003c/em\u003e result in an error!\n\u003c/p\u003e\u003cp\u003eWhen applied to a \u003ccode\u003e\u003ca\u003eFold\u003c/a\u003e\u003c/code\u003e the result is merely a \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e (and becomes safe).\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eIso\u003c/a\u003e\u003c/code\u003e s t a b       -\u003e \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t [a] [b]\n \u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t a b      -\u003e \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t [a] [b]\n \u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e s t a b -\u003e \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e s t [a] [b]\n \u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eFold\u003c/a\u003e\u003c/code\u003e s a          -\u003e \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e s [a]\n \u003ccode\u003e\u003ca\u003eunsafePartsOf\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e s a        -\u003e \u003ccode\u003e\u003ca\u003eGetter\u003c/a\u003e\u003c/code\u003e s [a]\n\u003c/pre\u003e",
