        "fct-descr": "\u003cp\u003eAccess the 1st field of a tuple (and possibly change its type).\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(1,2)^._1\n\u003c/code\u003e\u003c/strong\u003e1\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e_1 .~ \"hello\" $ (1,2)\n\u003c/code\u003e\u003c/strong\u003e(\"hello\",2)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(1,2) & _1 .~ \"hello\"\n\u003c/code\u003e\u003c/strong\u003e(\"hello\",2)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e_1 putStrLn (\"hello\",\"world\")\n\u003c/code\u003e\u003c/strong\u003ehello\n((),\"world\")\n\u003c/pre\u003e\u003cp\u003eThis can also be used on larger tuples as well:\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(1,2,3,4,5) & _1 +~ 41\n\u003c/code\u003e\u003c/strong\u003e(42,2,3,4,5)\n\u003c/pre\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003e_1\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e (a,b) (a',b) a a'\n \u003ccode\u003e\u003ca\u003e_1\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e (a,b,c) (a',b,c) a a'\n \u003ccode\u003e\u003ca\u003e_1\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e (a,b,c,d) (a',b,c,d) a a'\n ...\n \u003ccode\u003e\u003ca\u003e_1\u003c/a\u003e\u003c/code\u003e :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e (a,b,c,d,e,f,g,h,i) (a',b,c,d,e,f,g,h,i) a a'\n\u003c/pre\u003e",
