        "fct-descr": "\u003cp\u003eAccess the 2nd field of a tuple.\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e_2 .~ \"hello\" $ (1,(),3,4)\n\u003c/code\u003e\u003c/strong\u003e(1,\"hello\",3,4)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e(1,2,3,4) & _2 *~ 3\n\u003c/code\u003e\u003c/strong\u003e(1,6,3,4)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003e_2 print (1,2)\n\u003c/code\u003e\u003c/strong\u003e2\n(1,())\n\u003c/pre\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eanyOf\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e_2\u003c/a\u003e\u003c/code\u003e :: (s -\u003e \u003ccode\u003e\u003ca\u003eBool\u003c/a\u003e\u003c/code\u003e) -\u003e (a, s) -\u003e \u003ccode\u003e\u003ca\u003eBool\u003c/a\u003e\u003c/code\u003e\n \u003ccode\u003e\u003ca\u003etraverse\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e_2\u003c/a\u003e\u003c/code\u003e :: (\u003ccode\u003e\u003ca\u003eApplicative\u003c/a\u003e\u003c/code\u003e f, \u003ccode\u003e\u003ca\u003eTraversable\u003c/a\u003e\u003c/code\u003e t) =\u003e (a -\u003e f b) -\u003e t (s, a) -\u003e f (t (s, b))\n \u003ccode\u003e\u003ca\u003efoldMapOf\u003c/a\u003e\u003c/code\u003e (\u003ccode\u003e\u003ca\u003etraverse\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e_2\u003c/a\u003e\u003c/code\u003e) :: (\u003ccode\u003e\u003ca\u003eTraversable\u003c/a\u003e\u003c/code\u003e t, \u003ccode\u003e\u003ca\u003eMonoid\u003c/a\u003e\u003c/code\u003e m) =\u003e (s -\u003e m) -\u003e t (b, s) -\u003e m\n\u003c/pre\u003e",
