        "fct-descr": "\u003cp\u003eMany combinators that accept a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e can also accept a\n \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e in limited situations.\n\u003c/p\u003e\u003cp\u003eThey do so by specializing the type of \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e that they require of the\n caller.\n\u003c/p\u003e\u003cp\u003eIf a function accepts a \u003ccode\u003e\u003ccode\u003e\u003ca\u003eLensLike\u003c/a\u003e\u003c/code\u003e f s t a b\u003c/code\u003e for some \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e \u003ccode\u003ef\u003c/code\u003e,\n then they may be passed a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eFurther, if \u003ccode\u003ef\u003c/code\u003e is an \u003ccode\u003e\u003ca\u003eApplicative\u003c/a\u003e\u003c/code\u003e, they may also be passed a\n \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e.\n\u003c/p\u003e",
