        "fct-descr": "\u003cp\u003eThe only \u003ccode\u003e\u003ca\u003eLensLike\u003c/a\u003e\u003c/code\u003e law that can apply to a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e \u003ccode\u003el\u003c/code\u003e is that\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l y (\u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l x a) &#8801; \u003ccode\u003e\u003ca\u003eset\u003c/a\u003e\u003c/code\u003e l y a\n\u003c/pre\u003e\u003cp\u003eYou can't \u003ccode\u003e\u003ca\u003eview\u003c/a\u003e\u003c/code\u003e a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e in general, so the other two laws are irrelevant.\n\u003c/p\u003e\u003cp\u003eHowever, two \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e laws apply to a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e:\n\u003c/p\u003e\u003cpre\u003e\n \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e l \u003ccode\u003e\u003ca\u003eid\u003c/a\u003e\u003c/code\u003e &#8801; \u003ccode\u003e\u003ca\u003eid\u003c/a\u003e\u003c/code\u003e\n \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e l f \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e l g &#8801; \u003ccode\u003e\u003ca\u003eover\u003c/a\u003e\u003c/code\u003e l (f \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e g)\n\u003c/pre\u003e\u003cp\u003eThese can be stated more directly:\n\u003c/p\u003e\u003cpre\u003e\n l \u003ccode\u003e\u003ca\u003epure\u003c/a\u003e\u003c/code\u003e &#8801; \u003ccode\u003e\u003ca\u003epure\u003c/a\u003e\u003c/code\u003e\n l f \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003euntainted\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e l g &#8801; l (f \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003euntainted\u003c/a\u003e\u003c/code\u003e \u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e g)\n\u003c/pre\u003e\u003cp\u003eYou can compose a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e with a \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e or a \u003ccode\u003e\u003ca\u003eTraversal\u003c/a\u003e\u003c/code\u003e using (\u003ccode\u003e\u003ca\u003e.\u003c/a\u003e\u003c/code\u003e) from the \u003ccode\u003ePrelude\u003c/code\u003e\n and the result is always only a \u003ccode\u003e\u003ca\u003eSetter\u003c/a\u003e\u003c/code\u003e and nothing more.\n\u003c/p\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover traverse f [a,b,c,d]\n\u003c/code\u003e\u003c/strong\u003e[f a,f b,f c,f d]\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover _1 f (a,b)\n\u003c/code\u003e\u003c/strong\u003e(f a,b)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover (traverse._1) f [(a,b),(c,d)]\n\u003c/code\u003e\u003c/strong\u003e[(f a,b),(f c,d)]\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover both f (a,b)\n\u003c/code\u003e\u003c/strong\u003e(f a,f b)\n\u003c/pre\u003e\u003cpre class=\"screen\"\u003e\u003ccode class=\"prompt\"\u003e\u003e\u003e\u003e \u003c/code\u003e\u003cstrong class=\"userinput\"\u003e\u003ccode\u003eover (traverse.both) f [(a,b),(c,d)]\n\u003c/code\u003e\u003c/strong\u003e[(f a,f b),(f c,f d)]\n\u003c/pre\u003e",
