        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eUsage:\n\u003c/p\u003e\u003cp\u003eYou can derive lenses automatically for many data types:\n\u003c/p\u003e\u003cpre\u003e\n import Control.Lens\n data Foo a = Foo { _fooArgs :: [\u003ccode\u003e\u003ca\u003eString\u003c/a\u003e\u003c/code\u003e], _fooValue :: a }\n \u003ccode\u003e\u003ca\u003emakeLenses\u003c/a\u003e\u003c/code\u003e ''Foo\n\u003c/pre\u003e\u003cp\u003eThis defines the following lenses:\n\u003c/p\u003e\u003cpre\u003e\n fooArgs :: \u003ccode\u003e\u003ca\u003eLens'\u003c/a\u003e\u003c/code\u003e (Foo a) [\u003ccode\u003e\u003ca\u003eString\u003c/a\u003e\u003c/code\u003e]\n fooValue :: \u003ccode\u003e\u003ca\u003eLens\u003c/a\u003e\u003c/code\u003e (Foo a) (Foo b) a b\n\u003c/pre\u003e\u003cp\u003eYou can then access the value with (\u003ccode\u003e\u003ca\u003e^.\u003c/a\u003e\u003c/code\u003e) and set the value of the field\n with (\u003ccode\u003e\u003ca\u003e.~\u003c/a\u003e\u003c/code\u003e) and can use almost any other combinator that is re-exported\n here on those fields.\n\u003c/p\u003e\u003cp\u003eThe combinators here have unusually specific type signatures, so for\n particularly tricky ones, the simpler type signatures you might want to\n pretend the combinators have are specified as well.\n\u003c/p\u003e\u003cp\u003eMore information on how to use lenses is available on the lens wiki:\n\u003c/p\u003e\u003cp\u003e\u003ca\u003ehttp://github.com/ekmett/lens/wiki\u003c/a\u003e\n\u003c/p\u003e\u003cp\u003e\u003cimg src=\"Hierarchy.png\"/\u003e\n\u003c/p\u003e\u003c/div\u003e",
