        "fct-descr": "\u003cp\u003eThis function exists to remedy a gap between the functionality of \u003ccode\u003eControl.Exception\u003c/code\u003e\n and \u003ccode\u003eControl.Monad.Error\u003c/code\u003e. \u003ccode\u003eControl.Exception\u003c/code\u003e supplies \u003ccode\u003e\u003ca\u003ecatches\u003c/a\u003e\u003c/code\u003e and\n a notion of \u003ccode\u003e\u003ca\u003eHandler\u003c/a\u003e\u003c/code\u003e, which we duplicate here in a form suitable for\n working with any \u003ccode\u003e\u003ca\u003eMonadError\u003c/a\u003e\u003c/code\u003e instance.\n\u003c/p\u003e\u003cp\u003eSometimes you want to catch two different sorts of error. You could\n do something like\n\u003c/p\u003e\u003cpre\u003e\n f = \u003ccode\u003e\u003ca\u003ehandling\u003c/a\u003e\u003c/code\u003e _Foo handleFoo (\u003ccode\u003e\u003ca\u003ehandling\u003c/a\u003e\u003c/code\u003e _Bar handleBar expr)\n\u003c/pre\u003e\u003cp\u003eHowever, there are a couple of problems with this approach. The first is\n that having two exception handlers is inefficient. However, the more\n serious issue is that the second exception handler will catch exceptions\n in the first, e.g. in the example above, if \u003ccode\u003ehandleFoo\u003c/code\u003e uses \u003ccode\u003e\u003ca\u003ethrowError\u003c/a\u003e\u003c/code\u003e\n then the second exception handler will catch it.\n\u003c/p\u003e\u003cp\u003eInstead, we provide a function \u003ccode\u003e\u003ca\u003ecatches\u003c/a\u003e\u003c/code\u003e, which would be used thus:\n\u003c/p\u003e\u003cpre\u003e\n f = \u003ccode\u003e\u003ca\u003ecatches\u003c/a\u003e\u003c/code\u003e expr [ \u003ccode\u003e\u003ca\u003ehandler\u003c/a\u003e\u003c/code\u003e _Foo handleFoo\n                  , \u003ccode\u003e\u003ca\u003ehandler\u003c/a\u003e\u003c/code\u003e _Bar handleBar\n                  ]\n\u003c/pre\u003e",
